package dev.nqhuy.java;/* * Created by Chang Bee on 6/2/2017. */public class Employ implements Cloneable {    private String name;    private int age;    public Employ() {    }    public Employ(String name, int age) {        this.name = name;        this.age = age;    }    public String getName() {        return name;    }    public Employ setName(String name) {        this.name = name;        return this;    }    public int getAge() {        return age;    }    public Employ setAge(int age) {        this.age = age;        return this;    }}